import React from "react";
import styled from "styled-components";


class IndexPage extends React.Component {

  render() {
    return (
      <Wrapper> 
        Index page.
      </Wrapper>
    ); 
  }
}

const Wrapper = styled.div`
  margin: 20px;
  padding: 50px 10px 50px 10px;
  width: 100%;
  overflow: auto;
`

export default IndexPage;
